import React from 'react'
import PropTypes from 'prop-types';
import  { useState } from 'react';

export default function Navbar(nav) {
  return (
    <nav className={`navbar navbar-expand-lg bg-dark navbar-${props.dark}`}>
       {/* <nav className="navbar navbar-expand-lg bg-dark"></nav> */}
    <div className="container-fluid">
      <a className="navbar-brand text-white" href="/">{nav.mainTitle}</a>
      <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
        <span className="navbar-toggler-icon"></span>
      </button>
      <div className="collapse navbar-collapse" id="navbarSupportedContent">
        <ul className="navbar-nav me-auto mb-2 mb-lg-0">
          <li className="nav-item">
            <a className="nav-link text-white active" aria-current="page" href="/">{nav.homeText}</a>
          </li>
          <li className="nav-item">
            <a className="nav-link text-white" href="/">{nav.aboutText}</a>
          </li>
        </ul>
        <form className="d-flex" role="search">
          <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search" />
          <button className="btn btn-primary text-white" type="submit">Search</button>
        </form>
      </div>
    </div>
  </nav>
  )
}

//define the props datatypes using objects
Navbar.propTypes = {navtitle: PropTypes.string.isRequired, 
                    homeText: PropTypes.string.isRequired,
                    aboutText : PropTypes.string.isRequired}

    Navbar.defaultProps = {
        navtitle: 'Stranger',
        homeText: 'Home',
        aboutText: 'About'
    };
